<script lang="ts">
    import {onMount} from "svelte";
    import {south_bridge_payload} from "$lib";

    export let size:'sm'|'lg' = 'sm'

    let boot_state:SVGGElement;
    let idle_state:SVGGElement;
    let frmw_up_state:SVGGElement;
    let path_ch_state:SVGGElement;
    let exit_state:SVGGElement;
    let sys_check_state:SVGGElement;
    let est_con_state:SVGGElement;
    let hv_sys_check_state:SVGGElement;
    let emerg_brake_state:SVGGElement;
    let levi_state:SVGGElement;
    let accel_state:SVGGElement;
    let braking_state:SVGGElement;
    let cruising_state:SVGGElement;
    let lane_switch_state:SVGGElement;
    let all_states: SVGGElement[];

    function turn_on(state:SVGGElement) {
        if (state === emerg_brake_state) {
            state.style.fill = '#D61111'
        } else {
            state.style.fill = '#0EA774'
        }
    }

    function turn_off_all(states:SVGGElement[]) {
        states.forEach(s => s.style.fill = 'none');
    }

    onMount(() => {
        all_states = [boot_state, idle_state, frmw_up_state, path_ch_state, exit_state, sys_check_state, est_con_state, hv_sys_check_state, emerg_brake_state, levi_state, accel_state, braking_state, cruising_state, lane_switch_state];

        setInterval(() => {
            turn_off_all(all_states);
            turn_on(all_states[$south_bridge_payload.value % all_states.length])
        }, 100)
    })


</script>

